import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TablePagination from '@material-ui/core/TablePagination';
import TableRow from '@material-ui/core/TableRow';
import Button from '@material-ui/core/Button'

// add columns for number of visits and criminal record
const columns = [
  { id: 'number', label: 'Plate Number', minWidth: 100 },
  {
  id: 'location',
  label: 'Location',
  minWidth: 170,
  align: 'left',
  format: (value) => value.toFixed(2),
},
{
  id: 'recognitions',
  label: 'Recognitions',
  minWidth: 130,
  align: 'left',
  format: (value) => value.toLocaleString(),
},
  {
    id: 'time',
    label: 'Time Entered',
    minWidth: 170,
    align: 'left',
    format: (value) => value.toLocaleString(),
  },
  {
    id: 'date',
    label: 'Date',
    minWidth: 170,
    align: 'left',
    format: (value) => value.toLocaleString(),
  },
];

function createData(number, location, recognitions, time, date) {
  return { number, location, recognitions, time, date};
}

// const rows = [
//   // on an interval of time, get the data from the database and map it to the table

//   // plate number, recognized status, date, time entered, status
//   createData(123456, 'Front Entrance', 1, '2:50pm', '4/1/20'),
//   createData(789101, 'Back Parking Lot', 2, '1:11pm','4/1/20'),
//   createData(333333, 'Side Entrance', 1, '12:50pm','4/1/20'),
//   createData(100000, 'Back Parking Lot', 1, '12:00pm','4/1/20'),
//   createData(101010, 'Front Entrance', 1,'10:00am','4/1/20'),
//   createData(104050, 'Front Entrance', 1,'9:55am','4/1/20'),
//   createData(100000, 'Back Parking Lot', 3,'12:00pm','4/1/20'),
//   createData(100000, 'Back Parking Lot', 4,'12:00pm','4/1/20'),
//   createData(100000, 'Back Parking Lot', 5,'12:00pm','4/1/20'),
//   createData(100000, 'Back Parking Lot', 3,'12:00pm','4/1/20'),
//   createData(100000, 'Back Parking Lot', 2,'12:00pm','4/1/20'),
//   createData(100000, 'Back Parking Lot', 1,'12:00pm','4/1/20'),
// ];

const useStyles = makeStyles({
  root: {
    backgroundColor: '#E5E5E5',
    color: '#E5E5E5',
    width: '100%',
    height: '200%'
  },
  container: {
    backgroundColor: '#E5E5E5',
    maxHeight: 580,
  },
});

export default function StickyHeadTable(props) {

  // const rows = [
  //   // on an interval of time, get the data from the database and map it to the table

  //   // plate number, recognized status, date, time entered, status
  //   createData(123456, 'Front Entrance', 1, '2:50pm', '4/1/20'),
  //   createData(789101, 'Back Parking Lot', 2, '1:11pm','4/1/20'),
  //   createData(333333, 'Side Entrance', 1, '12:50pm','4/1/20'),
  //   createData(100000, 'Back Parking Lot', 1, '12:00pm','4/1/20'),
  //   createData(101010, 'Front Entrance', 1,'10:00am','4/1/20'),
  //   createData(104050, 'Front Entrance', 1,'9:55am','4/1/20'),
  //   createData(100000, 'Back Parking Lot', 3,'12:00pm','4/1/20'),
  //   createData(100000, 'Back Parking Lot', 4,'12:00pm','4/1/20'),
  //   createData(100000, 'Back Parking Lot', 5,'12:00pm','4/1/20'),
  //   createData(100000, 'Back Parking Lot', 3,'12:00pm','4/1/20'),
  //   createData(100000, 'Back Parking Lot', 2,'12:00pm','4/1/20'),
  //   createData(100000, 'Back Parking Lot', 1,'12:00pm','4/1/20'),
  // ];

  const rows = props.dataList.map((d, i) => {
    createData(d.plateNumber, d.location, d.entryNumber, '2:00', '4/5/2020')
  })

  const classes = useStyles();
  const [page, setPage] = React.useState(0);
  const [rowsPerPage, setRowsPerPage] = React.useState(10);

  const handleChangePage = (event, newPage) => {
    setPage(newPage);
  };

  const handleChangeRowsPerPage = (event) => {
    setRowsPerPage(+event.target.value);
    setPage(0);
  };

  return (
    <Paper className={classes.root}>
      <TableContainer className={classes.container}>
        <Table stickyHeader aria-label="sticky table">
          <TableHead style={{backgroundColor: '#E5E5E5'}}>
            <TableRow>
              {columns.map((column) => (
                <TableCell
                  key={column.id}
                  align={column.align}
                  style={{ minWidth: column.minWidth }}
                >
                  {column.label}
                </TableCell>
              ))}
            </TableRow>
          </TableHead>
          <TableBody>
            {rows.slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage).map((row) => {
              return (
                <TableRow hover role="checkbox" tabIndex={-1} >
                  {columns.map((column) => {
                    const value = 'row[column.id]';
                    return (
                      <TableCell key={column.id} align={column.align}>
                        {column.format && typeof value === 'number' ? column.format(value) : value}
                      </TableCell>
                    );
                  })}
                </TableRow>
              );
            })}
          </TableBody>
        </Table>
      </TableContainer>
      <TablePagination
        rowsPerPageOptions={[10, 25, 100]}
        component="div"
        count={rows.length}
        rowsPerPage={rowsPerPage}
        page={page}
        onChangePage={handleChangePage}
        onChangeRowsPerPage={handleChangeRowsPerPage}
      />
      <div style={{width: '100%', marginTop: '25px'}}>
        <strong style={{color: '#333'}}>Sort By: </strong>
      <Button>Most Recent</Button>
      <Button>Most Frequent</Button>
      </div>
    </Paper>
  );
}
